export default function Miempresa() {
    return (
        <Tabs style={{background: "yellow"}} onChange={callback} type="card">
            <TabPane tab="Tab 1" key="1">
            Content of Tab Pane 1
            </TabPane>
            <TabPane tab="Tab 2" key="2">
            Content of Tab Pane 2
            </TabPane>
        </Tabs>
    )
}
